    </View>

    <View style={style.paragraphContainer}>
      <Text>
        Vous êtes prêt·e ? Vraiment ?
        Alors allez-y !
      </Text>

      <TouchableOpacity
        onPress={() => {}}
      >
        <Ionicons
          name="play-circle"
          size={70}
          color={COLORS.darkYellow}
          style={specificStyle.playBtn}
        />
      </TouchableOpacity>
    </View>
  </View>
);

export default Play;
